(1, 'Perceraian', 'Gugatan  Perceraian Pegawai Negeri Sipil', 'izin:Surat Kepala Badan Kepegawaian Daerah Kabupaten Sidoarjo tanggal 4 November 2019 Nomor : 800/2875/438.6.4/2019, perihal Permohonan Izin Melakukan Perceraian Pegawai Negeri Sipil.\r\nketerangan:Surat  Kepala  Badan  Kepegawaian Daerah Kabupaten Sidoarjo tanggal 14  Agustus  2019 Nomor : x.800/69/438.6.4/2019, perihal Permohonan Surat Keterangan Adanya Gugatan Perceraian Pegawai Negeri Sipil.', '700', '{\"lokasi\": \"0\", \"tambahan\": \"1\"}', '{\"1\": \"Izin melakukan perceraian\", \"2\": \"Surat keterangan cerai\"}', 'pengawasan', '2020-02-23 16:21:28', '2020-03-10 14:22:42'),
(8, 'Audit Operasional', 'Audit Operasional', 'Undang - Undang Republik Indonesia Nomor 9 Tahun 2015 tentang perubahan kedua atas Undang-undang Nomor 23 Tahun  2014  Tentang  Pemerintah Daerah;\r\nPeraturan Pemerintah Republik Indonesia Nomor 12 Tahun 2017     tentang Pembinaan dan Pengawasan Penyelenggaraan    Pemerintahan Daerah;\r\nPeraturan Menteri Dalam Negeri Nomor 61 Tahun 2019 tentang Perencanaan  Pengawasan Penyelenggaraan Pemerintahan Daerah Tahun 2020;\r\nProgram Kerja Pengawasan Tahunan (PKPT) Inspektorat Daerah Kabupaten Sidoarjo Tahun 2020;', '700', '{\"lokasi\": \"1\", \"tambahan\": \"0\"}', '{\"1\": null, \"2\": null}', 'pengawasan', '2020-02-26 13:55:36', '2020-03-08 12:49:31'),
(7, 'Evaluasi SAKIP', 'Evaluasi  Implementasi  Sistem Akuntabilitas  Kinerja  Instansi  Pemerintah (SAKIP)', 'Undang - Undang Republik Indonesia Nomor 23 Tahun  2014  tentang  Pemerintah Daerah;\r\nPeraturan Pemerintah Republik  Indonesia Nomor 12 Tahun 2017     tentang Pedoman Pembinaan dan Pengawasan Penyelenggaraan    Pemerintahan Daerah;\r\nPeraturan Presiden Nomor 29 Tahun 2014 tentang Sistem Akuntabilitas Kinerja Instansi Pemerintah;\r\nPeraturan Menteri  Pendayagunaan Aparatur Negara Nomor 12 Tahun 2015 tentang Pedoman Evaluasi Atas Implementasi SAKIP;\r\nPeraturan Menteri Dalam  Negeri Nomor  35 Tahun 2018 tentang Kebijakan Pembinaan dan Pengawasan Penyelenggaraan Pemerintah Daerah Tahun 2019;\r\nPeraturan Bupati Nomor 19 Tahun 2016 tentang Petunjuk Pelaksanaan Evaluasi atas Implementasi  Sistem  Akuntabilitas  Kinerja Instansi Pemerintah (SAKIP) di Lingkungan Pemerintah Kabupaten Sidoarjo;\r\nPeraturan Bupati Nomor 45 Tahun 2017 tentang Perubahan atas Peraturan Bupati Nomor 19 Tahun 2016;\r\nProgram Kerja Pengawasan Tahunan (PKPT) Inspektorat Daerah Kabupaten Sidoarjo Tahun 2019;', '700', '{\"lokasi\": \"0\", \"tambahan\": \"1\"}', '{\"1\": null, \"2\": null}', 'pengawasan', '2020-02-26 13:39:09', '2020-02-26 13:39:09'),
(2, 'Riktu', 'Pemeriksaan dengan tujuan tertentu', 'Undang-Undang Republik Indonesia Nomor 23 Tahun 2014 tentang Pemerintah Daerah;\r\nPeraturan Pemerintah Republik Indonesia Nomor 12 Tahun 2017 tentang Pembinaan dan Pengawasan Penyelenggaraan Pemerintahan Daerah;\r\nPeraturan Negeri Dalam Negeri Nomor 110 Tahun 2017 tentang Kebijakan Pembinaan dan Pengawasan Penyelenggaraan Pemerintah Daerah Tahun 2018;\r\nProgram Kerja Pengawasan Tahunan (PKPT) Inspektorat Daerah Kabupaten Sidoarjo Tahun 2019;', '700', '{\"lokasi\": \"1\", \"tambahan\": \"0\"}', '{\"1\": null, \"2\": null}', 'pengawasan', '2020-02-23 16:33:29', '2020-02-26 16:28:58'),
(3, 'TGR', 'pemeriksaan dalam rangka Proses Tuntutan Ganti Rugi atas kehilangan barang milik daerah', 'Surat Sekretariat Daerah Kabupaten Sidoarjo tanggal 19  Juni  2019 Nomor : 950/5374/438.6.2/2019, perihal Penyelesaian Tuntutan Ganti Rugi (TGR) atas Kehilangan Barang Milik Daerah.', '700', '{\"lokasi\": \"0\", \"tambahan\": \"1\"}', '{\"1\": null, \"2\": null}', 'pengawasan', '2020-02-23 16:37:33', '2020-02-26 14:02:56'),
(4, 'PKKN', 'Audit Penghitungan Kerugian Keuangan Negara terhadap dugaan tindak pidana korupsi', 'Surat Kepala Kepolisian Resort Kota Sidoarjo tanggal 10  April 2019 Nomor : B/1110/IV. Res.3.3/2019/Satreskrim, perihal Permintaan Bantuan Audit Penghitungan Kerugian Keuangan Negara.', '700', '{\"lokasi\": \"0\", \"tambahan\": \"1\"}', '{\"1\": null, \"2\": null}', 'pengawasan', '2020-02-23 17:29:24', '2020-02-26 14:02:23'),
