(9, 'Evaluasi PMPRB', 'Evaluasi dan Verifikasi Penilaian Mandiri Pelaksanaan Reformasi Birokrasi (PMPRB)', 'Undang - Undang Republik Indonesia Nomor 23 Tahun  2014  Tentang  Pemerintah Daerah;\r\nPeraturan Pemerintah Republik Indonesia Nomor 12 Tahun 2017     tentang Pembinaan dan Pengawasan Penyelenggaraan    Pemerintahan Daerah;\r\nPeraturan Menteri Pendayagunaan Aparatur Negara dan Reformasi Birokrasi Republik Indonesia Nomor 30 Tahun 2018 tentang Perubahan Peraturan Menteri Pendayagunaan Aparatur Negara dan Reformasi Birokrasi Nomor 14 Tahun 2014 tentang Pedoman Evaluasi Reformasi Birokrasi Instansi Pemerintah;\r\nPeraturan Menteri Dalam Negeri Nomor 35 Tahun 2018 tentang Kebijakan  Pengawasan Penyelenggaraan Pemerintah Daerah Tahun 2019;\r\nProgram Kerja Pengawasan Tahunan (PKPT) Inspektorat Daerah Kabupaten Sidoarjo Tahun 2019;', '700', '{\"lokasi\": \"0\", \"tambahan\": \"1\"}', '{\"1\": null, \"2\": null}', 'pengawasan', '2020-02-26 16:17:19', '2020-02-26 16:17:19'),
